import { } from 'react-bootstrap'

function LeftBar({ show }) {
    return (
        <div id="mySidenav" class="sidenav">
            <a href="/" class="closebtn" onClick="closeNav()">&times;</a>
            <a href="/login">About</a>
        </div>
    )
}

export default LeftBar
